.contain-table {
  overflow: inherit !important;
}
.cateValueTable {
  margin-top: 20px;
  border: 1px solid #eee;
}
.basicTable {
  margin-top: 20px;
  border: 1px solid #eee;
}
.cascaderAll2 {
  width: 600px;
}
.addCata {
  margin: 5px 0px;
}
.scollViews {
  overflow-y: scroll;
  height: calc(100% - 70px);
}
.titleTop {
  height: 60px;
  border-radius: 6px;
  background: linear-gradient(
    90deg,
    rgba(245, 237, 220, 1) 0%,
    rgba(250, 247, 240, 1) 100%
  );
  display: flex;
  align-items: center;
  position: relative;
  .bg {
    position: absolute;
    right: 20px;
  }
  .tableIcon {
    padding: 1px 5px;
    color: rgba(214, 156, 21, 1);
    border: 1px solid rgba(214, 156, 21, 1);
    margin-left: 20px;
    font-size: 12px;
  }
  .titleName {
    color: rgba(56, 56, 56, 1);
    font-size: 14px;
    padding-left: 8px;
  }
}
.basicinfo {
  .titleTag {
    color: rgba(56, 56, 56, 1);
    font-size: 14px;
    padding: 12px 10px;
    border-bottom: 1px solid #eee;
    .name {
      padding-bottom: 10px;
      border-bottom: 3px solid rgba(97, 189, 83, 1);
    }
  }
}
.detailsView {
  height: calc(100vh - 135px);
  padding: 16px;
  margin: 0 16px 16px 16px;
  background: #fff;
  border-radius: 8px;

  @import "./style.scss";
  ::v-deep .el-radio.is-disabled {
    color: #61bd53;
    .el-radio__inner {
      border-color: #61bd53;
    }
    .el-radio__inner::after {
      background-color: #61bd53;
    }
    .el-radio__label {
      color: #61bd53;
    }
  }
}
